&lt;p&gt;Product details&lt;/p&gt;
&lt;p&gt;&lt;/p&gt;
&lt;p&gt;The premium wool dryer balls for static are a green, energy saving laundry drying solution. Wool dryer ball is an economic alternative for chemicals dryer sheets, liquid fabric softener and one-time use products; it provides a safe, sustainable and healthy
    life for your family.&lt;/p&gt;
&lt;p&gt;FAQ&lt;/p&gt;
&lt;p&gt;1. Still get static after using these wool balls?&lt;/p&gt;
&lt;p&gt;Answer: One cause of static is over drying, you can pull the balls just a little early or put a little essential oil on the balls.&lt;/p&gt;
&lt;p&gt;Another cause of static is synthetic materials like polyester, nylon, rayon and acrylic. You may notice polyester or nylon loads are the worst! Try to separate synthetics to keep the rest of your laundry static-free. Then either dry the synthetics by
    hanging them on a line or in the dryer, making sure you end the drying cycle before they are totally dry.&lt;/p&gt;
&lt;p&gt;&lt;/p&gt;
&lt;p&gt;Package Including: 1*Wool Dryer Ball&lt;/p&gt;
&lt;p&gt;&lt;/p&gt;
&lt;p&gt;All natural, Made from 100% New Zealand Wool&lt;/p&gt;
&lt;p&gt;Organic dryer balls- Reusable Natural Fabric Softener.&lt;/p&gt;
&lt;p&gt;Natural wool dryer balls, no chemicals, no fillers, no allergy, unscented.&lt;/p&gt;
&lt;p&gt;Hypoallergenic dryer balls are safe for babies, the aged &amp;amp; anyone who has sensitive skin.&lt;/p&gt;
&lt;p&gt;Reusable dryer balls reduce harmful chemicals to environment!&lt;/p&gt;
&lt;p&gt;Extra Large dryer balls, a little larger than a tennis ball.&lt;/p&gt;
&lt;p&gt;&lt;/p&gt;
&lt;p&gt;Household Tips for Time and Money Savings&lt;/p&gt;
&lt;p&gt;No repeated cost for chemical fabric softener, wool dryer balls can be used over 1500 times, typically last 2-3 years.&lt;/p&gt;
&lt;p&gt;Dryer balls for laundry reduce 15%-25% drying time by circulating hot air between the wet items.Reduce your need to iron clothes and prevent static cling.&lt;/p&gt;
&lt;p&gt;Organic dryer balls won't harm your dryer machine, no chemical residues.&lt;/p&gt;
&lt;p&gt;Better Laundry Time&lt;/p&gt;
&lt;p&gt;Wool dryer balls naturally soften clothing, towels, sheets and blankets without chemicals.&lt;/p&gt;
&lt;p&gt;Enjoy soft, fluffy, fragrant clothes with your family.&lt;/p&gt;
&lt;p&gt;Effectively reducing wrinkles, static cling, twisting, tangling, lint &amp;amp; pet hair!&lt;/p&gt;
&lt;p&gt;Wool dryer balls bounce around in your dryer machine gentlely, it is lower bouncing noise than plastic balls.&lt;/p&gt;
&lt;p&gt;How do dryer balls work?&lt;/p&gt;
&lt;p&gt;1. Place 3-4 pcs organic wool dryer balls for small or medium load, 5- 6 pcs for large load.&lt;/p&gt;
&lt;p&gt;2. Put 1-2 drops of essential oil to get wonderful smell of your laundry.&lt;/p&gt;
&lt;p&gt;3. Over-drying may increase static cling, try to set shorter time or use moisture-sensitive setting to prevent static cling.&lt;/p&gt;
&lt;p&gt;Tips&lt;/p&gt;
&lt;p&gt;Drying ball provides a fun toy for your pets and it is safe for them.&lt;/p&gt;
&lt;p&gt;Give your clothes a wonderful scent by adding your favorite lavender or tea tree essential oils to dryer balls (essential oil not included).&lt;/p&gt;
&lt;p&gt;Pack of 6 laundry dryer balls is a considerate gift for Baby showers, Mother's day, Christmas, Housewarming.&lt;/p&gt;
&lt;p&gt;Natural wool dryer balls are also suitable for Laundromats, apartments, dorms, and hotels.&lt;/p&gt;
&lt;p&gt;Try pinning a small safety pin on one ball to diffuse static.&lt;/p&gt;

